using namespace std;
char check(char a, char b) {
  if (a == '(' && b == ')')
    return 'r';
  else if (a == '[' && b == ']')
    return 'p';
  else
    return 's';
}
int win(char a, char b) {
  if (a == 'r' && b == 'p') return -1;
  if (a == 'p' && b == 's') return -1;
  if (a == 's' && b == 'r') return -1;
  if (a != b) return 1;
  return 0;
}
int main() {
  string s1, s2;
  cin >> s1 >> s2;
  int len = s1.length();
  int t1 = 0, t2 = 0;
  for (int i = 0; i < len; i += 2) {
    char c1 = check(s1[i], s1[i + 1]);
    char c2 = check(s2[i], s2[i + 1]);
    int winner = win(c1, c2);
    if (winner == -1)
      t2++;
    else if (winner == 1)
      t1++;
  }
  if (t1 == t2)
    cout << "TIE\n";
  else if (t1 > t2)
    cout << "TEAM 1 WINS\n";
  else
    cout << "TEAM 2 WINS\n";
  return 0;
}

