import sys

def compare_figures(first, second):
    #print 'Compare_figures called. First: {0}, second: {1}'.format(first, second)
    return \
        first == '[]' and second == '8<' or \
        first == '()' and second == '[]' or \
        first == '8<' and second == '()'

class Figure(object):
    def __init__(self, word):
        if not word in ['8<', '[]', '()']:
            raise RuntimeError('Wrong word')
        self.word = word

    def __lt__(self, other):
        return compare_figures(self.word, other.word)

    def __eq__(self, other):
        return self.word == other.word

    def __repr__(self):
        return {'8<' : 'Scissors', '[]' : 'Paper', '()' : 'Stone'}[self.word]


