  return (a % b == 0 ? b : GCD(b, a % b));
}
long long int POW(long long int base, long long int exp) {
  long long int val;
  val = 1;
  while (exp > 0) {
    if (exp % 2 == 1) {
      val = (val * base) % 1000000007;
    }
    base = (base * base) % 1000000007;
    exp = exp / 2;
  }
  return val;
}
