public class cf409a {
  static FastIO in = new FastIO(), out = in;

  public static void main(String[] args) {
    String a = in.next().trim();
    String b = in.next().trim();
    int score = 0;
    for(int i=0; i<a.length(); i+=2) {
      String x = a.substring(i,i+2);
      String y = b.substring(i,i+2);
      score += calc(x, y);
    }
    if(score > 0) out.println("TEAM 1 WINS");
    else if(score < 0) out.println("TEAM 2 WINS");
    else out.println("TIE");
    out.close();
  }
  static int calc(String a, String b) {
    if(a.equals(b)) return 0;
    if(a.equals("[]") && b.equals("()")) return 1;
    if(a.equals("()") && b.equals("8<")) return 1;
    if(a.equals("8<") && b.equals("[]")) return 1;
    return -1;
  }

  static class FastIO extends PrintWriter {
    BufferedReader br;
    StringTokenizer st;

    public FastIO() {
      this(System.in, System.out);
    }

    public FastIO(InputStream in, OutputStream out) {
      super(new BufferedWriter(new OutputStreamWriter(out)));
      br = new BufferedReader(new InputStreamReader(in));
      scanLine();
    }

    public void scanLine() {
      try {
        st = new StringTokenizer(br.readLine().trim());
      } catch (Exception e) {
        throw new RuntimeException(e.getMessage());
      }
    }

    public int numTokens() {
      if (!st.hasMoreTokens()) {
        scanLine();
        return numTokens();
      }
      return st.countTokens();
    }

    public String next() {
      if (!st.hasMoreTokens()) {
        scanLine();
        return next();
      }
      return st.nextToken();
    }

    public double nextDouble() {
      return Double.parseDouble(next());
    }

    public long nextLong() {
      return Long.parseLong(next());
    }

    public int nextInt() {
      return Integer.parseInt(next());
    }
  }
}

