public class A {

	public static void main(String[] args) {
		FasterScanner sc = new FasterScanner();
		PrintWriter out = new PrintWriter(System.out);
		String A = sc.next();
		String B = sc.next();
		int score = 0;
		for(int a=0;a<A.length();a+=2){
			int typeA = magic(A.charAt(a),A.charAt(a+1));
			int typeB = magic(B.charAt(a),B.charAt(a+1));
			if(typeA==typeB)continue;
			if(typeB==1&&typeA==0)score++;
			else if(typeB==0&&typeA==-1)score++;
			else if(typeB==-1&&typeA==1)score++;
			else score--;
		}
		if(score==0)out.println("TIE");
		else if (score>0)out.println("TEAM 2 WINS");
		else if (score<0)out.println("TEAM 1 WINS");

		out.close();
	}


	private static int magic(char a, char b) {
		if(a=='8')return 1;
		if(a=='(')return -1;
		return 0;
	}


	static class FasterScanner{
		private InputStream stream;
		private byte[] buf = new byte[1024];
		private int curChar;
		private int numChars;

		public FasterScanner(){
			stream = System.in;
			//stream = new FileInputStream(new File("dec.in"));

		}
		int read(){
			if(numChars==-1)
				throw new InputMismatchException();
			if(curChar>=numChars){
				curChar = 0;
				try{
					numChars = stream.read(buf);
				} catch (IOException e){
					throw new InputMismatchException();
				}
				if(numChars <= 0)
					return -1;
			}
			return buf[curChar++];
		}

		boolean isSpaceChar(int c){
			return c==' '||c=='\n'||c=='\r'||c=='\t'||c==-1;
		}
		boolean isEndline(int c){
			return c=='\n'||c=='\r'||c==-1;
		}
		int nextInt(){
			return Integer.parseInt(next());
		}
		long nextLong(){
			return Long.parseLong(next());
		}
		double nextDouble(){
			return Double.parseDouble(next());
		}
		String next(){
			int c = read();
			while(isSpaceChar(c))
				c=read();
			StringBuilder res = new StringBuilder();
			do{
				res.appendCodePoint(c);
				c=read();
			} while(!isSpaceChar(c));
			return res.toString();
		}
		String nextLine(){
			int c = read();
			while(isEndline(c))
				c=read();
			StringBuilder res = new StringBuilder();
			do{
				res.appendCodePoint(c);
				c = read();
			}while(!isEndline(c));
			return res.toString();
		}

	}


