public class A implements Closeable {
    BufferedReader reader = new BufferedReader(new InputStreamReader(System.in));
    PrintWriter writer = new PrintWriter(new BufferedWriter(new OutputStreamWriter(System.out)));

    A() throws IOException {
//        reader = new BufferedReader(new FileReader("input.txt"));
//        writer = new PrintWriter(new FileWriter("output.txt"));
    }

    StringTokenizer stringTokenizer;

    String next() throws IOException {
        while (stringTokenizer == null || !stringTokenizer.hasMoreTokens()) {
            stringTokenizer = new StringTokenizer(reader.readLine());
        }
        return stringTokenizer.nextToken();
    }

    int nextInt() throws IOException {
        return Integer.parseInt(next());
    }

    long nextLong() throws IOException {
        return Long.parseLong(next());
    }

    double nextDouble() throws IOException {
        return Double.parseDouble(next());
    }

    private int MOD = 1000 * 1000 * 1000 + 7;

    int sum(int a, int b) {
        a += b;
        return a >= MOD ? a - MOD : a;
    }

    int product(int a, int b) {
        return (int) (1l * a * b % MOD);
    }

    int pow(int x, int k) {
        int result = 1;
        while (k > 0) {
            if (k % 2 == 1) {
                result = product(result, x);
            }
            x = product(x, x);
            k /= 2;
        }
        return result;
    }

    int inv(int x) {
        return pow(x, MOD - 2);
    }

    void solve() throws IOException {
        char[] team1 = next().toCharArray();
        char[] team2 = next().toCharArray();
        Map<Character, Map<Character, Integer>> rules = new HashMap<>();
        char[] moves = "8[(".toCharArray();
        for(int i = 0; i < 3; i++) {
            Map<Character, Integer> r = new HashMap<>();
            for(int j = -1; j <= 1; j++) {
                r.put(moves[(i + j + 3) % 3], j);
            }
            rules.put(moves[i], r);
        }
        int score = 0;
        for(int i = 0; i < team1.length; i += 2) {
            score += rules.get(team1[i]).get(team2[i]);
        }
        writer.println(score > 0 ? "TEAM 1 WINS" : (score == 0 ? "TIE" : "TEAM 2 WINS"));
    }

    public static void main(String[] args) throws IOException {
        try (A a = new A()) {
            a.solve();
        }
    }

    @Override
    public void close() throws IOException {
        reader.close();
        writer.close();
    }
}

