		for (int i = 0; i < n; i += 2) {
			if (a.charAt(i) != b.charAt(i)) {
				if (a.charAt(i) == '[') {
					if (b.charAt(i) == '8')
						win2 ++;
					else if (b.charAt(i) == '(')
						win1 ++;
				} else if (a.charAt(i) == '8') {
					if (b.charAt(i) == '[')
						win1 ++;
					else if (b.charAt(i) == '(')
						win2 ++;
				} else if (a.charAt(i) == '(') {
					if (b.charAt(i) == '8')
						win1 ++;
					else if (b.charAt(i) == '[')
						win2 ++;
				}
			}
		}

