						scoreA++;
					if (second.equals("[]"))
						scoreB++;

					break;
				}
				case "8<": {
					if (second.equals("[]"))
						scoreA++;
					if (second.equals("()"))
						scoreB++;

					break;
				}
			}
		}
		if (scoreA > scoreB) {
			out.println("TEAM 1 WINS");
		} else if (scoreB > scoreA) {
			out.println("TEAM 2 WINS");
		} else {
			out.println("TIE");
		}
	}


