        String a = in.next();
        String b = in.next();
        int as = 0, bs = 0;
        for (int i = 0; i < a.length(); i += 2) {
            if (a.substring(i,i + 2).equals("8<")) {
                if (b.substring(i,i + 2).equals("[]")) {
                    as++;
                } else {
                    if (!a.substring(i,i + 2).equals(b.substring(i,i + 2)))
                        bs++;
                }
            } else {
                if (a.substring(i,i + 2).equals("[]")) {
                    if (b.substring(i,i + 2).equals("8<")) {
                        bs++;
                    } else {
                        if (!a.substring(i,i + 2).equals(b.substring(i,i + 2)))
                        as++;
                    }
                } else {
                    if (b.substring(i,i + 2).equals("8<")) {
                        as++;
                    } else {
                        if (!a.substring(i,i + 2).equals(b.substring(i,i + 2)))
                        bs++;
                    }
                }
            }
        }
        if (as > bs) {
            out.print("TEAM 1 WINS");
        } else if (as < bs) {
            out.print("TEAM 2 WINS");
        } else {
            out.print("TIE");
        }
    }
}

class FastScanner {
    public BufferedReader br;
    public StringTokenizer st;

    public FastScanner(InputStream stream) {
        br = new BufferedReader(new InputStreamReader(stream));
        st = null;
    }

    public String next() {
        while (st == null || !st.hasMoreTokens()) {
            try {
                st = new StringTokenizer(br.readLine());
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
        return st.nextToken();
    }

}

