public class HalcoContest {

    public static void main(String[] args) {
        Scanner in = new Scanner(System.in);
        String t1 = in.nextLine();
        String t2 = in.nextLine();
        int sum = 0;
        for (int i = 0; i < t1.length(); i += 2) {
            switch (t1.charAt(i)) {
                case '[': {
                    if (t2.charAt(i) == '8') {
                        sum--;
                    }
                    if (t2.charAt(i) == '(') {
                        sum++;
                    }
                    break;
                }
                case '8': {
                    if (t2.charAt(i) == '[') {
                        sum++;
                    }
                    if (t2.charAt(i) == '(') {
                        sum--;
                    }
                    break;
                }
                case '(': {
                    if (t2.charAt(i) == '8') {
                        sum++;
                    }
                    if (t2.charAt(i) == '[') {
                        sum--;
                    }
                }
            }
        }
        if (sum < 0) {
            System.out.println("TEAM 2 WINS");
        } else if (sum > 0) {
            System.out.println("TEAM 1 WINS");
        } else {
            System.out.println("TIE");
        }
    }
}

